import React, {Component} from 'react';
import './index.css';

class Home extends Component {
    constructor() {
        super();
        this.state = {};
    };

    render() {
        return(
            <>
                <h1>Keep your finances safe.</h1>
                <p>When traveling, you are 50% more likely to lose your card or wallet. Meta is a digital wallet with acess to real card printing. Create disposable burner identites when traveling abroad to protect the one that matters most to you: yours.</p>
            </>
        )
    };
}

export default Home;
